<article class="amp-wp-article story">

	<div class="cinema">

	</div>

	<div class="story-header">
		<div class="header-content">
			<a href="https://theundefeated.com/tag/college-football/" class="term" name="">College Football</a>
			<h1 class="heading entry-title"><span>FSU coach Willie Taggart buys lunch for local football campers, wins the day</span></h1>
			<p class="subheading">The Seminoles coach filled stomachs, and filled hearts even more</p>
		</div>
	</div>

	<div class="story-body story-blog">
			<figure class="featured-image pull-out">
				<amp-img width="1400" height="786" src="https://theundefeated.com/wp-content/uploads/2018/06/CHL180414052_FSU_Spring_Game_24155707-e1528403123382.jpg?w=700" class="attachment-large size-large wp-post-image amp-wp-enforced-sizes" alt="" layout="intrinsic"></amp-img>
				<figcaption class="featured-image__figcaption">
						<span class="featured-image__caption">Florida State head coach Willie Taggart goes around the stadium high flving fans during the Florida State spring football game at Bobby Bowden Field at Doak Campbell Stadium in Tallahassee, FL on April, 14th, 2018. </span>
						<span class="featured-image__credit">Logan Stanford/Icon Sportswire </span>
				</figcaption>
			</figure>

		<div class="meta pull-out">
			<div class="byline-timestamp-mod">
				<div class="author-block author-block--headshot">
					<a href="https://drewroberts.com/about" class="avatar wright"><amp-img alt="Drew Roberts" src="https://theundefeated.com/wp-content/uploads/2016/05/wright.png?quality=90&amp;strip=info&amp;w=90&amp;ssl=1" width="90" height="90" class="amp-wp-enforced-sizes" layout="intrinsic"></amp-img></a>
					<span class="meta-author vcard">
						<span class="byline">By <a href="https://drewroberts.com/about" title="" class="author url fn" rel="author">Drew Roberts</a></span>
						<a href="https://twitter.com/DrewRoberts" class="author-twitter">@DrewRoberts</a>
					</span>
				</div>
				<time class="timestamp updated" datetime="2018-06-07T20:28:10+00:00">June 7, 2018</time>
			</div>
		</div>

	<div class="story-content">

		<span class="inner-content"><div class="social-share">
<amp-social-share width="38" height="38" type="twitter" class="share-twitter"></amp-social-share><amp-social-share width="38" height="38" type="facebook" class="share-facebook" data-param-app_id="834240743288407"></amp-social-share><amp-social-share width="38" height="38" type="email" class="share-email"></amp-social-share>
</div>
<p><span class="time-posted"><a href="https://theundefeated.com/whhw/fsu-coach-willie-taggart-buys-lunch-for-local-football-campers-wins-the-day/">4:28 PM</a></span>Willie Taggart is a “see something, say something” kind of guy, and his good deed for 200 football campers this week is a testament to that.</p>

<p>The Florida State University head coach, who was hired last December, happened to come upon Florida State’s Junior Noles football camp that was held Monday to Wednesday of this week. The camp for students entering first through eighth grade cost $230 and included an FSU football camp T-shirt, but it didn’t include lunch, according to the <em>Miami Herald</em>.</p>
<p>Taggart, a Palmetto, Florida, native who himself played at Manatee High in Bradenton, wasn’t having that. According to a tweet from Palm Beach Nole, Taggart approached a man running the camp, which ran from 8 a.m. to 1 p.m., and inquired about lunch for the kids. When told that lunch was not included, Taggart jumped into coach mode, telling the man: “That’s not happening. Get on the phone and order some food for these kids.”</p>
<p>Pizza arrived soon afterward, the tweet says, and on Tuesday Jimmy John’s and ice cream were on the menu — all courtesy of Taggart.</p>
<p>“I believe Willie himself paid for lunch for three days for over 200 kids out of his own pocket,” Palm Beach Nole’s tweet said. “Real talk. He didn’t have to do it, no parents expected it, but this is the way he is, just a genuine, really good human. I couldn’t be more proud that he represents FSU.”</p>
<p>Taggart, the 11th overall and first African-American head coach in the program’s history, takes the reins previously held for eight seasons by Jimbo Fisher, now the head coach at Texas A&amp;M. Since being hired, Taggart, 41, has made an immediate impact. His program has one of the youngest coaching staffs in Division I football; eight of Taggart’s coaches have an average age of 44.4, signaling a new era. Also noteworthy: Seven of the eight assistants are African-American, creating a pipeline for minority head-coaching candidates down the road.</p>
<p>His move was noticed, and applauded, by the Fritz Pollard Alliance, an affinity group dedicated to creating opportunities for minority candidates, scouts and front-office personnel.</p>
<p>“You have to be committed. That’s why Willie Taggart is a very, very admirable person,” said John Wooten, chairman of the FPA, which was formed in 2003 and named after Pollard, the first African-American coach in NFL history. “The minorities that get the opportunities as head coaches or athletic directors have to take it upon themselves and have to be committed to going out and finding the young minorities who are in various positions around the country in order to build those kinds of pipelines.”</p>
<p>With his good deed, Taggart, widely known as an ace recruiter, not only filled bellies but also may have solidified the program’s recruiting class for the next decade or longer. Palm Beach Nole (tweeting from @Jroc1738) is sold: “Wow!! That’s my coach!! @CoachTaggart you did a wonderful thing! #DidSomething”</p>
</span>

